export default function ProfileCard({avatar, name, occupation, hobbies}) {
    return (
        <div className="profile-card">
      <img src={avatar} alt={`${name} avatar`} className="profile-avatar" />
      <h2>{name}</h2>
      <h3>{occupation}</h3>
      <p>{hobbies}</p>
    </div>
  );
}
